import "./style.css"

var page = 0
var length = 0

export default function Caroussel(props) {
    const imgs = props.imgs

    return (
        <div className="caroussel">
            {imgs.map((items, key) => {
                length = items.length
                if (key == props.page) {
                    return (
                        <div>
                            <img key={key} className="carousselImg" src={items}></img>
                            <button key={key} onClick={Inc()}></button>
                        </div>
                    )
                }
            })}
        </div>
    )
}

function Inc() {
    if (page <= length) {
        page++
        console.log(page)
    } else {
        page = 0
    }
}
